import React from 'react';
import {
  Grid,
  Card,
  CardContent,
  Button,
  Input,
  TextField,
} from '@material-ui/core';
import { Formik, Form as FormikForm } from 'formik';
//@ts-ignore
import { FormikTextField } from 'formik-material-fields';

import { useHistory } from 'react-router-dom';
import * as S from './styles';

const SigninForm = () => {
  const history = useHistory();

  const handleSubmit = () => {
    history.push('/Dashboard');
  };
  return (
    <S.FormWrapper>
      <Grid container justify="center" alignItems="center">
        {/* <Card>
          <CardContent> */}
        <Grid container spacing={2}>
          <Grid item xs={12}>
            <p style={{ color: 'white' }}>Email:</p>
            <Input
              style={{
                // width: '400px',
                border: 'solid 1px orange',
                color: 'gray',
                borderRadius: '8px',
                background: 'black',
                opacity: 0.6,
              }}
            />
          </Grid>
          <Grid item xs={12}>
            <p style={{ color: 'white' }}>Senha:</p>
            <Input
              type="password"
              style={{
                // width: '400px',
                border: 'solid 1px orange',
                borderRadius: '8px',
                background: 'black',
                color: 'gray',
                opacity: 0.6,
              }}
            />
          </Grid>
          <Grid item xs={12}>
            <Button
              onClick={() => history.push('/Dashboard')}
              variant="outlined"
              type="submit"
              color="default"
            >
              Entrar
            </Button>
          </Grid>
        </Grid>
        {/* </CardContent>
        </Card> */}
      </Grid>
    </S.FormWrapper>
    // </FullWidthContainer>
  );
};

export default SigninForm;
